import { Outlet, Link } from "react-router-dom";

const Layout = () => {
    return (
      <>
        <nav>


              <Link to="/">PageComponent</Link>


              <Link to="/ChooseGamemode">ChooseGamemode</Link>


        </nav>
  
        <Outlet />
      </>
    )
  };
  
  export default Layout;
